import React from 'react';
import ListGroup from 'react-bootstrap/ListGroup';
import './ScriptList.css';

function ScriptList() {
    let scripts = [
        {
            name: 'Script 1',
            value: 'example value 1',
        },
        {
            name: 'Script 2',
            value: 'example value 2',
        },
        {
            name: 'Script 3',
            value: 'example value 3',
        },
        {
            name: 'Script 4',
            value: 'example value 4',
        },
        {
            name: 'Script 5',
            value: 'example value 5',
        },
        {
            name: 'Script 5',
            value: 'example value 6',
        },
    ];

    function createListItems() {
        let items = [];
        for (let i = 0; i < scripts.length; i++) {
            items.push(
                <ListGroup.Item action href={`#link${i}`} key={i}>
                    {scripts[i].name}
                </ListGroup.Item>
            );
        }
        return items;
    }

    return (
        <ListGroup className='script-list' defaultActiveKey='#link0'>
            {createListItems()}
        </ListGroup>
    );
}

export default ScriptList;
